import React from 'react';

// containers
import Welcome from './containers/Welcome';
import Portfolio from './containers/Portfolio'

function App(props) {
  console.log(props);

  return (
    <Welcome render={data => (
      <Portfolio
      props
        data={data} />
    )} />
  );
}

export default App;
